package test.jmul.math.numbers;


import jmul.math.numbers.Number;
import static jmul.math.numbers.NumberHelper.createNumber;

import java.math.BigInteger;

import jmul.concurrent.threads.ThreadHelper;

import jmul.test.classification.ManualTest;

import org.junit.Ignore;


/**
 * A test suite to compare number creation with the java standard library.
 *
 * @author Kristian Kutin
 */
@ManualTest
@Ignore
public class CreateNumberVariant2Test {

    /**
     * The mai nmethod.
     *
     * @param args
     *        command line arguments are ignored
     */
    public static void main(String... args) {

        experiment1();
        triggerGC();

        experiment2();
        triggerGC();

        experiment3();
        triggerGC();

        System.out.println("done.");
    }

    private static void experiment1() {

        System.out.println("experiment #1");

        String s =
            "";
        BigInteger i = new BigInteger(s);

        System.out.println("s=" + s);
        System.out.println("i=" + i);
    }

    private static void experiment2() {

        System.out.println("experiment #2");

        String s =
            "";
        BigInteger i = new BigInteger(s);

        System.out.println("s=" + s);
        System.out.println("i=" + i);
        System.out.println("bit length=" + i.bitLength());

        long start = System.currentTimeMillis();

        i = i.add(i);

        long end = System.currentTimeMillis();
        long delta = end - start;

        System.out.println("" + delta + " ms");

        System.out.println("i=" + i);
        System.out.println("bit length=" + i.bitLength());
    }

    private static void experiment3() {

        System.out.println("experiment #3");

        Number i;
        {
            String s =
                "";
            System.out.println("s=" + s);

            i = createNumber(10, s);
        }

        triggerGC();

        System.out.println("i=" + i);
        //System.out.println("digits=" + i.digits());

        long start = System.currentTimeMillis();

        i = i.add(i);

        long end = System.currentTimeMillis();
        long delta = end - start;

        System.out.println("" + delta + " ms");

        System.out.println("i=" + i);
        //System.out.println("digits=" + i.digits());
    }

    private static void triggerGC() {

        System.gc();
        ThreadHelper.sleep(100L);
    }

}
